	<div>
	<input type="textbox" id="txtfind"/>
	<button onclick="findNode()" >Find Me!</button>
	</div>
	  
	</body>


	<script type="text/javascript">
		function findNode()
		{
			var find = document.getElementById("txtfind").value.toLowerCase();
			var node = d3.select("#node_"+find);
		//	node[0][0].r.animVal.value =2000;
			//node[0][0].attr("fill","#000");
		}

		(function(){
		var width = 1800,
		    height = 1800;

		var scaledcolor = d3.scale.category20();
		var color = function(v){
			if(v>=0 && v<100)
				return scaledcolor(1);
			if(v>=100 && v<200)
				return scaledcolor(2);
			if(v>=200 && v<300)
				return scaledcolor(3);
			if(v>=300 && v<400)
				return scaledcolor(4);
			if(v>=400 && v<500)
				return scaledcolor(5);
			if(v>=500 && v<600)
				return scaledcolor(6);
			if(v>=600 && v<700)
				return scaledcolor(7);
			if(v>=700 && v<800)
				return scaledcolor(8);
			if(v>=800 && v<900)
				return scaledcolor(9);
			if(v>=900 && v<1000)
				return scaledcolor(10);
			if(v>=1000 && v<1100)
				return scaledcolor(11);
			if(v>=1100 && v<1200)
				return scaledcolor(12);
			if(v>=1200 && v<1300)
				return scaledcolor(13);

			return scaledcolor(20);			
		};		

		var force = d3.layout.force()
		    .charge(-5000)
		    .linkDistance(300)		    
		    .gravity(5)
		    .size([width, height]);

		var svg = d3.select("body").append("svg")
		    .attr("width", width)
		    .attr("height", height);

		var graph = getData();

		var nodeMap = {};


		graph.nodes.forEach(function(d) { 
			if(d.Followers > 25) nodeMap[d.Name] = d; 
		});

/* 
	Links cleanup -- due to the fact I am not pulling in all members, I need to filter out orphaned follows.
*/
		var links = [];
		graph.links.forEach(function(l) {					    
		    l.source = nodeMap[l.source];
		    l.target = nodeMap[l.target];

		    if(l.source && l.target){
		    	links.push(l);
		    }
		});
		graph.links = links;


		force.nodes(graph.nodes)
		    .links(graph.links)
		    .start();

		var link = svg.selectAll(".link")
		    .data(graph.links)
		    .enter().append("line")
		    .attr("class", "link")
		    .style("stroke-width", function(d) {
		        return d.Value/10;
		    });

		var node = svg.selectAll(".node")
		    .data(graph.nodes)
		    .enter().append("circle")
		    .attr("class", "node")
		    .attr("r", function(d){ return Math.sqrt(d.Followers);})
		    .style("fill", function(d) {return color(d.Followers); })
		    .style("stroke", "#000")
		    .attr("id", function(d){ return "node_"+d.Name.toLowerCase();})
		    .call(force.drag); //


		node.append("title")
		    .text(function(d) { return d.Name + " : "+ d.Followers; });

		force.on("tick", function() {
		    link.attr("x1", function(d) { return d.source.x; })
		        .attr("y1", function(d) { return d.source.y; })
		        .attr("x2", function(d) { return d.target.x; })
		        .attr("y2", function(d) { return d.target.y; });

		    node.attr("cx", function(d) { return d.x; })
		        .attr("cy", function(d) { return d.y; });
		});
